This class is a custom `LayerDrawable` in Android that stacks multiple drawables (icons) on top of each other, scaling them down by a specified factor (`iconScale`). It also positions the icons in the center of the bounds with a small inset to avoid overlapping.

In Swift, you can create a similar class using `CALayer` and `UIImage` instead of `LayerDrawable` and `Drawable`. Here's a basic example:

```swift
import UIKit

class StackedLayers {
    private var layers: [CALayer] = []
    private let iconScale: CGFloat = 0.7

    init(layers: [UIImage], iconScale: CGFloat = 0.7) {
        self.layers = layers.map { CALayer() }
        self.iconScale = iconScale
        setupLayers()
    }

    func setupLayers() {
        for (index, layer) in layers.enumerated() {
            let imageLayer = CALayer()
            imageLayer.contents = layer.cgImage
            imageLayer.frame = bounds
            imageLayer.bounds = CGRect(origin: .zero, size: CGSize(width: bounds.width * iconScale, height: bounds.height * iconScale))
            imageLayer.position = CGPoint(x: bounds.midX, y: bounds.midY)
            self.layers[index] = imageLayer
        }
    }

    var bounds: CGRect {
        didSet {
            for layer in layers {
                layer.bounds = CGRect(origin: .zero, size: CGSize(width: bounds.width * iconScale, height: bounds.height * iconScale))
                layer.position = CGPoint(x: bounds.midX, y: bounds.midY)
            }
        }
    }
}
```

